import React from "react";
import { NavLink, useHistory } from "react-router-dom";
import swal from "sweetalert";
import axios from "axios";

function Navbar() {
  const history = useHistory();
  const logoutSubmit = (e) => {
    e.preventDefault();

    axios.post(`/api/logout`).then((res) => {
      if (res.data.status === 200) {
        localStorage.removeItem("auth_token");
        localStorage.removeItem("auth_name");
        swal("Success", res.data.message, "success");
        history.push("/");
      }
    });
  };


  let authButtons = null;
  if (!localStorage.getItem("auth_token")) {
    authButtons = (
      <>
        <NavLink
          className="text-gray-300 hover:bg-gray-700 no-underline hover:text-white rounded-md px-3 py-2 text-sm font-medium"
          to="/login"
          activeStyle={{
            backgroundColor: "blue",
          }}
        >
          Login
        </NavLink>

        <NavLink
          className="text-gray-300 hover:bg-gray-700 no-underline hover:text-white rounded-md px-3 py-2 text-sm font-medium"
          to="/register"
          activeStyle={{
            backgroundColor: "red",
          }}
        >
          Register
        </NavLink>
      </>
    );
  } else {
    authButtons = (
      <button
        type="button"
        onClick={logoutSubmit}
        className="text-gray-300 hover:bg-gray-700 hover:text-white rounded-md px-3 py-2 text-sm font-medium"


      >
        Logout
      </button>
    );
  }

  return (
    <nav style={{ backgroundColor: '#222222' }}>
      <div className="mx-auto max-w-7xl px-2 sm:px-6 lg:px-8">
        <div className="relative flex h-16 items-center justify-between">
          <div className="absolute inset-y-0 left-0 flex items-center sm:hidden">
            <button
              type="button"
              className="inline-flex items-center justify-center rounded-md p-2 text-gray-400 hover:bg-gray-700 hover:text-white focus:outline-none focus:ring-2 focus:ring-inset focus:ring-white"
              aria-controls="mobile-menu"
              aria-expanded="false"
            >
              <span className="sr-only">Open main menu</span>
              <svg
                className="block h-6 w-6"
                fill="none"
                viewBox="0 0 24 24"
                strokeWidth="1.5"
                stroke="currentColor"
                aria-hidden="true"
              >
                <path
                  strokeLinecap="round"
                  strokeLinejoin="round"
                  d="M3.75 6.75h16.5M3.75 12h16.5m-16.5 5.25h16.5"
                />
              </svg>
              <svg
                className="hidden h-6 w-6"
                fill="none"
                viewBox="0 0 24 24"
                strokeWidth="1.5"
                stroke="currentColor"
                aria-hidden="true"
              >
                <path
                  strokeLinecap="round"
                  strokeLinejoin="round"
                  d="M6 18L18 6M6 6l12 12"
                />
              </svg>
            </button>
          </div>
          <div className="flex">
            <NavLink className="navbar-brand" to="/">
              <img
                className="block h-30 w-30"
                src="cloth.png"
                alt="Your Company"
                style={{ height: "13rem" }}
              />
            </NavLink>
          </div>

          <div className="flex flex-1 items-center justify-center sm:items-stretch sm:justify-start">
            <div className="hidden sm:ml-6 sm:block">
              <div className="flex space-x-4">
                <NavLink
                  exact
                  to="/"
                  className="hover:bg-gray-700 no-underline text-white rounded-md px-3 py-2 text-sm font-medium"
                  activeStyle={{
                    backgroundColor: "red",
                  }}
                >
                  Home
                </NavLink>

                <NavLink
                  to="/about"
                  className="text-gray-300 hover:bg-gray-700 no-underline hover:text-white rounded-md px-3 py-2 text-sm font-medium"
                  activeStyle={{
                    backgroundColor: "red",
                  }}
                >
                  About
                </NavLink>

                <NavLink
                  to="/contact"
                  className="text-gray-300 hover:bg-gray-700 no-underline hover:text-white rounded-md px-3 py-2 text-sm font-medium"
                  activeStyle={{
                    backgroundColor: "red",
                  }}
                >
                  Contact
                </NavLink>

                <NavLink
                  to="/collections"
                  className="text-gray-300 hover:bg-gray-700 no-underline hover:text-white rounded-md px-3 py-2 text-sm font-medium"
                  activeStyle={{
                    backgroundColor: "red",
                  }}
                >
                  Category
                </NavLink>

                <NavLink
                  to="/cart"
                  className="text-gray-300 hover:bg-gray-700 no-underline hover:text-white rounded-md px-3 py-2 text-sm font-medium"
                  activeStyle={{
                    backgroundColor: "red",
                  }}
                >
                  Cart
                </NavLink>

                <NavLink
                  to="/orders"
                  className="text-gray-300 hover:bg-gray-700 no-underline hover:text-white rounded-md px-3 py-2 text-sm font-medium"
                  activeStyle={{
                    backgroundColor: "red",
                  }}
                >
                  My Orders
                </NavLink>

                {authButtons}
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* Mobile menu */}
      <div className="sm:hidden" id="mobile-menu">
        <div className="space-y-1 px-2 pb-3 pt-2">
          <NavLink
            exact
            to="/"
            className="bg-gray-900 text-white rounded-md px-3 py-2 text-sm font-medium"
            activeStyle={{
              backgroundColor: "red",
            }}
          >
            Home
          </NavLink>

          <NavLink
            to="/about"
            className="text-gray-300 hover:bg-gray-700 hover:text-white rounded-md px-3 py-2 text-sm font-medium"
            activeStyle={{
              backgroundColor: "red",
            }}
          >
            About
          </NavLink>

          <NavLink
            to="/contact"
            className="text-gray-300 hover:bg-gray-700 hover:text-white rounded-md px-3 py-2 text-sm font-medium"
            activeStyle={{
              backgroundColor: "red",
            }}
          >
            Contact
          </NavLink>

          <NavLink
            to="/collections"
            className="text-gray-300 hover:bg-gray-700 hover:text-white rounded-md px-3 py-2 text-sm font-medium"
            activeStyle={{
              backgroundColor: "red",
            }}
          >
            Collection
          </NavLink>

          <NavLink
            to="/cart"
            className="text-gray-300 hover:bg-gray-700 hover:text-white rounded-md px-3 py-2 text-sm font-medium"
            activeStyle={{
              backgroundColor: "red",
            }}
          >
            Cart
          </NavLink>

          {authButtons}
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
